"""##### SyllableTokenizer

Sonority Sequencing Principle - –ü—Ä–∏–Ω—Ü–∏–ø —Å–µ–∫–≤–µ–Ω–∏—Ä–æ–≤–∞–Ω–∏—è –∑–≤—É—á–∞–Ω–∏—è - —ç—Ç–æ —Ñ–æ–Ω–æ—Ç–∞–∫—Å–∏—á–µ—Å–∫–∏–π –ø—Ä–∏–Ω—Ü–∏–ø, —Ü–µ–ª—å –∫–æ—Ç–æ—Ä–æ–≥–æ - –æ—á–µ—Ä—Ç–∏—Ç—å —Å—Ç—Ä—É–∫—Ç—É—Ä—É —Å–ª–æ–≥ —Å —Ç–æ—á–∫–∏ –∑—Ä–µ–Ω–∏—è –∑–≤—É—á–Ω–æ—Å—Ç–∏ .

SSP —É—Ç–≤–µ—Ä–∂–¥–∞–µ—Ç, —á—Ç–æ —è–¥—Ä–æ ‚Äã‚Äã—Å–ª–æ–≥–∞ (—Ü–µ–Ω—Ç—Ä —Å–ª–æ–≥–∞), —á–∞—Å—Ç–æ –≥–ª–∞—Å–Ω—ã–π, —Å–æ—Å—Ç–∞–≤–ª—è–µ—Ç –ø–∏–∫ –∑–≤—É—á–Ω–æ—Å—Ç–∏, –∫–æ—Ç–æ—Ä—ã–π –ø—Ä–µ–¥—à–µ—Å—Ç–≤—É–µ—Ç –∏ / –∏–ª–∏ —Å–ª–µ–¥—É–µ—Ç –ø–æ—Å–ª–µ–¥–æ–≤–∞—Ç–µ–ª—å–Ω–æ—Å—Ç—å —Å–µ–≥–º–µ–Ω—Ç–æ–≤ - —Å–æ–≥–ª–∞—Å–Ω—ã—Ö - —Å –ø–æ—Å—Ç–µ–ø–µ–Ω–Ω–æ —É–º–µ–Ω—å—à–∞—é—â–∏–º–∏—Å—è –∑–Ω–∞—á–µ–Ω–∏—è–º–∏ –∑–≤—É—á–Ω–æ—Å—Ç–∏ (—Ç. –µ. –∑–≤—É—á–Ω–æ—Å—Ç—å –¥–æ–ª–∂–Ω–∞ –ø–∞–¥–∞—Ç—å –∫ –æ–±–æ–∏–º –∫—Ä–∞—è–º —Å–ª–æ–≥–∞).


![image.png](data:image/png;base64,)

[–û –∫—Ä–∏—Ç–µ—Ä–∏–∏ —Å–ª–æ–≥–æ–¥–µ–ª–µ–Ω–∏—è –≤ —Å–æ–≤—Ä–µ–º–µ–Ω–Ω–æ–º —Ä—É—Å—Å–∫–æ–º —è–∑—ã–∫–µ](https://www.philol.msu.ru/~ruslang/data/pdf/vya1999-1.pdf)

![image.png](data:image/png;base64,)
"""

tokenizer = SyllableTokenizer(
    lang='ru', 
    sonority_hierarchy=[
        '–∞–µ—ë–∏–æ—É—ã—ç—é—è', # –≥–ª–∞—Å–Ω—ã–µ
        '–º–Ω', # –Ω–æ—Å–æ–≤—ã–µ
        '–≤—Ñ–∑—Å–∂—à—Ö', # —Ñ—Ä–∏–∫–∞—Ç–∏–≤–Ω—ã–µ
        '—Ä–ø–±–¥—Ç–∫–≥—â', # —Å—Ç–æ–ø–æ–≤—ã–µ
    ] # https://www.philol.msu.ru/~fonetica/kons/n-12.htm
)
print(tokenizer.tokenize('–∞–Ω—Ç–∏–¥–æ–ø–∏–Ω–≥–æ–≤—ã—Ö'))

